import React from "react";
import "./UserList.css";
import UserListItems from "./UserListItems";
import Card from "../UI/Card";

const UserList = (props) => {
  return (
    <div>
      <Card>
        {props.items.map((item) => (
          <UserListItems userName={item.userName} age={item.age} />
        ))}
      </Card>
    </div>
  );
};

export default UserList;
